  [],\n\t\"revision_timestamp\": \"2016-02-29T01:19:15.021926\",\n\t\"name\": \"temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observation556ab\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143944 includes discrete
  sample and profile data collected from DISCOVERY in the Indian Ocean, South Atlantic
  Ocean and Southern Oceans (> 60 degrees South) from 1993-02-06 to 1993-03-18. These
  data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
  (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED OXYGEN, Delta Oxygen-18, HYDROSTATIC
  PRESSURE, NITRATE, SALINITY, WATER TEMPERATURE, phosphate and silicate. The instruments
  used to collect these data include CTD and bottle.nnThese data were collected by
  Robert R. Dickson of Fisheries Laboratory - Lowestoft as part of the WOCE_S04_74DI19930206
  data set. CDIAC associated the following cruise ID(s) with this data set: WOCE_S04_1993nnThe
  World Ocean Circulation Experiment (WOCE) was a major component of the World Climate
  Research Program with the overall goal of better understanding the ocean's role
  in climate and climatic changes resulting from both natural and anthropogenic causes.
  The CO2 survey took advantage of the sampling opportunities provided by the WOCE
  Hydrographic Program (WHP) cruises during this period between 1990 and 1998. The
  final collection covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"license_title\":
